INSERT INTO `posts` VALUES (1, 1, 'Langkanya Minyang Goreng Dipasaran', '<p>Asosiasi Pengusaha Ritel Indonesia (Aprindo) meminta Kementerian Perdagangan (Kemendag) untuk memerintahkan para distributor untuk memasok minyak goreng ke pasar tradisional, bukan hanya ke ritel modern.&nbsp;</p>', 0, 'Langkanya Minyang Goreng Dipasaran', '<p>Asosiasi Pengusaha Ritel Indonesia (Aprindo) meminta Kementerian Perdagangan (Kemendag) untuk memerintahkan para distributor untuk memasok minyak goreng ke pasar tradisional, bukan hanya ke ritel modern. Menurutnya hal ini bertujuan agar masyarakat tidak membeli minyak goreng di ritel modern saja, sehingga stok minyak goreng di ritel modern tidak minim.</p>', 'langkanya-minyang-goreng-dipasaran.jpg', 'langkanya-minyang-goreng-dipasaran', NULL, NULL, 0, '2022-03-10 04:10:12', NULL, '2022-04-05 00:51:39', NULL);
INSERT INTO `posts` VALUES (3, 3, 'Membuat Kue Coklat', '<p>Resep brownies:<br>- 150 gr dark cooking chocolate (dcc)<br>- 35 gr cokelat bubuk<br>- 50 gr margarin<br>- 40 ml minyak<br>- 135 gr gula pasir diblender<br>- 100 gr tepung terigu pro sedang<br>- 2 butir telur<br>- sejumput garam</p><p>Bahan cheesecake:<br>- 200 gr cheesecake<br>- 50 gr margarin<br>- 40 gr gula pasir diblender<br>- 30 gr tepung terigu<br>- 1 sdt vanilla esscence<br>- 1 butir kuning telur</p><p>Cara membuat:<br>1. Buat adonan brownies, dcc dan margarin dilelehkan.<br>2. Kocok telur dan gula pasir halus sampai gula larut, lalu tambahkan coklat, margarin, dan minyak. Aduk rata.<br>3. Tambahkan tepung terigu dan cokelat bubuk, sedikit garam aduk kembali, sampai tidak ada gumpalan.<br>4. Masukkan ke loyang, sisakan sedikit adonan.<br>5. Kemudian kocok cheesecake dan margarin dengan whisker atau mixer kecepatan rendah.<br>6. Tambahkan gula pasir halus, kuning telur dan terigu, masukkan di atas adonan brownies.<br>7. Masukkan kembali sisa adonan brownies di atasnya dan ditusuk acak dengan tusuk gigi.<br>8. Jika menggunakan loyang sekat bisa ditambahkan aneka toping.<br>9. Panggang dengan suhu 170 derajat celcius, dalam waktu 30 menit.</p>', 0, 'Membuat Kue Coklat', '<p>Resep brownies:<br>- 150 gr dark cooking chocolate (dcc)<br>- 35 gr cokelat bubuk<br>- 50 gr margarin<br>- 40 ml minyak<br>- 135 gr gula pasir diblender<br>- 100 gr tepung terigu pro sedang<br>- 2 butir telur<br>- sejumput garam</p><p>Bahan cheesecake:<br>- 200 gr cheesecake<br>- 50 gr margarin<br>- 40 gr gula pasir diblender<br>- 30 gr tepung terigu<br>- 1 sdt vanilla esscence<br>- 1 butir kuning telur</p><p>Cara membuat:<br>1. Buat adonan brownies, dcc dan margarin dilelehkan.<br>2. Kocok telur dan gula pasir halus sampai gula larut, lalu tambahkan coklat, margarin, dan minyak. Aduk rata.<br>3. Tambahkan tepung terigu dan cokelat bubuk, sedikit garam aduk kembali, sampai tidak ada gumpalan.<br>4. Masukkan ke loyang, sisakan sedikit adonan.<br>5. Kemudian kocok cheesecake dan margarin dengan whisker atau mixer kecepatan rendah.<br>6. Tambahkan gula pasir halus, kuning telur dan terigu, masukkan di atas adonan brownies.<br>7. Masukkan kembali sisa adonan brownies di atasnya dan ditusuk acak dengan tusuk gigi.<br>8. Jika menggunakan loyang sekat bisa ditambahkan aneka toping.<br>9. Panggang dengan suhu 170 derajat celcius, dalam waktu 30 menit.</p>', 'membuat-kue-coklat.jpg', 'membuat-kue-coklat', NULL, NULL, 1, '2022-03-24 09:14:22', NULL, '2022-04-05 00:39:03', NULL);
