INSERT INTO `posts` VALUES (14, 3, 'Resep Lotus Biscoff Cheese Cake', '<p>Lotus Biscoff Cheesecake yang viral satu Malaysia. Dikenali juga sebagai Lotus Speculoos, kat Europe panggil speculoos, dan biasanya di UK dan US dipanggil biscoff. Selain cream cheese&hellip;2 bahan utama cheesecake ni adalah Lotus Biscoff cookies, dan Lotus Biscoff spread. Kemudian Ada 3 bahagian, iaitu untuk buat base, kedua untuk filling tengah iaitu adunan cheese, dan ketiga, hiasan topping atas cheesecake.Rujuk video untuk cara nak dapatkan dripping effect yang cantik pada hujung video.</p>', 0, 'Resep', '<p>resep</p>', 'VYvv_Z-BBew', 'resep-lotus-biscoff-cheese-cake', NULL, NULL, 1, '2022-06-06 09:22:05', NULL, '2022-06-06 09:26:18', NULL);
